import React from 'react';
import './IntroductionSection.css';
import Anonymous from './Anonymous.png';

export default function IntroductionSection() {
    return (
        <div className="intro">
            &nbsp; {/* non-breaking space */}
            <h1 
            style={{fontSize: 40}}
            className="intro_title">
                <u>
                Welcome to my Website !
                </u>
            </h1>
            &nbsp;
            <h3>
                You can find here extended information about my CV, what projects I have done 
                (with code sources and explanation).
            </h3>
            <h3>
                For now, this website is rudimentary, but I will improve it as my knowledge of react grows.
            </h3>
            &nbsp;
            <img className="photo" src={Anonymous} width="400" height="400" alt="whaaaat" />
            <div className="vertical_space"/>
        </div>
    )
}
